import { Box, MenuItem, List, ListItem, ListItemText, Divider, Select, InputLabel, FormControl } from '@mui/material'
import { useState } from 'react';
import DeskFooter from './deskComponents/DeskFooter';


const Footer = ({responsive}) => {

  const [selectCountry, setSelectCountry] = useState(['españa', 'englad', 'portugal', 'france'])
  const [selected, setSelected] = useState(selectCountry[0])
  const [arrAyuda, setArrAyuda] = useState(['Ayuda', 'Como comprar', 'Pago', 'Envio', 'Cambios y devoluciones', 'Garantia y postventa'])
  const [arrEmpresa, setArrEmpresa] = useState(['Empresa', 'Tiendas', 'Contactos'])
  const [arrPoliticas, setArrPoliticas] = useState(['Politicas', 'Politica de privacidad', 'Condiciones de uso y compra', 'Politicas de cookies', 'Aviso legal'])
  const [arrUnete, setArrUnete] = useState(['Unete', 'Instagram', 'Facebook', 'Pinterest', 'Linkedin', 'Mi cuenta', 'Contacto'])

  if(responsive.desk) {
    return (
        <DeskFooter selectCountry={selectCountry} selected={selected} arrAyuda={arrAyuda} arrEmpresa={arrEmpresa}
        arrPoliticas={arrPoliticas} arrUnete={arrUnete}/>
      )
  }
  
}

export default Footer
